  background:#111111;
`
const Tabs= styled (Typography)`
  font-size:20px;
  margin-right:20px;
`

 function Navbar(){
    return(
        <Header position='static'>
            <Toolbar>
                <NavLink to="">Crud App</NavLink>
                <Tabs>All Users</Tabs>
                <Tabs>Add Users</Tabs>
            </Toolbar>
        </Header>
    )
 }
 export default Navbar
